import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import { View, TouchableOpacity } from 'react-native';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome';
import { faHouse, faCamera, faImage, faBars, faQuestion } from '@fortawesome/free-solid-svg-icons';



const Stack = createStackNavigator();

function CustomFooter({navigation}) {
  return (
    <View style={{ flexDirection: 'row', justifyContent: 'space-around', backgroundColor: 'rgba(239, 239, 240, 0.884)', padding: 10 }}>
      <TouchableOpacity onPress={() => navigation.navigate('Home')}>
        <FontAwesomeIcon icon={faHouse} size={32} />
      </TouchableOpacity>
      <TouchableOpacity onPress={() => navigation.navigate('Login')}>
        <FontAwesomeIcon icon={faCamera} size={32} />
      </TouchableOpacity>
      <TouchableOpacity onPress={() => navigation.navigate('SignUp')}>
        <FontAwesomeIcon icon={faImage} size={32} />
      </TouchableOpacity>
      <TouchableOpacity onPress={() => navigation.navigate('UserHome')}>
        <FontAwesomeIcon icon={faBars} size={32} />
      </TouchableOpacity>
      <TouchableOpacity onPress={() => navigation.navigate('RegistrationSuccess')}>
        <FontAwesomeIcon icon={faQuestion} size={32} />
      </TouchableOpacity>
    </View>
  );
}

export function RootNavigator() {
  return (
    <Stack.Navigator>
      {/* ... Ihre Stack.Screens ... */}
      <Stack.Screen 
        name="CustomFooter"
        component={CustomFooter}
        options={{
          headerShown: false
        }}
      />
    </Stack.Navigator>
  );
}
